import "./App.css";

function App() {
  const [time, setTime] = useState("Ashish Ranjan");

  const myFunc = () => {
    setTime("Adarsh Ranjan");
  };

  return (
    <>
      <div className="cls">
        <div className="center" style={{ textAlign: "center" }}>
          <p> {time} </p>
          <button onClick={myFunc}>Click Here</button>
        </div>
      </div>
    </>
  );
}

export default App;

